import React from "react";
import '../App.css'
import { Link } from 'react-router-dom'
import { FaCloud, FaSearch, FaInfoCircle, FaSignInAlt } from 'react-icons/fa';

class Navigation extends React.Component {
  render() {
    return (
      <nav className="flex jcsb bgBlue  fixed" style={{ padding: "15px", left: 0, right: 0 }}>

<div className="flex tac aic textXL w50<i class='fa fa-cloud'></i>">
<FaCloud/> &nbsp;&nbsp;  Meteo 
</div>
        <div className="flex jcsb aic w50 tac textM">
          <Link style={{textDecoration: "none"}} className="aic flex nav" to='/'><FaSearch />&nbsp;<p>Search</p></Link>
          <Link style={{textDecoration: "none"}} className="aic flex nav" to='/about'><FaInfoCircle />&nbsp;<p>About Me</p></Link>
          <Link style={{textDecoration: "none"}} className="aic flex nav" to='/firebaselogin'><FaSignInAlt />&nbsp;<p>Login</p></Link>
        </div>
      </nav>

    );
  }
}


export default Navigation;
